import React from "react";
import { Form, Input } from "antd";

const LoginForm = () => {
    return (
        <Form>
            <div>
                <label hmtlFor="user-id">아이디</label>
                <br />
                <Input type="text" name="user-id"></Input>
            </div>
        </Form>
    );
};

export default LoginForm;
